"use strict";(self.webpackChunk_tc_server_widgets=self.webpackChunk_tc_server_widgets||[]).push([[980],{25938:function(e){e.exports=JSON.parse('{"domain":"messages","locale_data":{"messages":{"":{"domain":"messages","plural_forms":"nplurals=4; plural=((n%10==1 && n%100!=11) ? 0 : ((n%10 >= 2 && n%10 <=4 && (n%100 < 12 || n%100 > 14)) ? 1 : ((n%10 == 0 || (n%10 >= 5 && n%10 <=9)) || (n%100 >= 11 && n%100 <= 14)) ? 2 : 3));","lang":"uk_UA"},"Only a predefined number of video windows can be added to this layout":["Працює з заздалегідь визначеною кількістю відеоокон, яку не можна змінити"],"Button\\u0004Add":["Додати"],"Button\\u0004Apply":["Застосувати"],"Button\\u0004Additional":["Додатково"],"Button\\u0004Cancel":["Скасувати"],"Button\\u0004Layout type":["Тип розкладки"],"Heading\\u0004Select a participant":["Виберіть учасника"],"Heading\\u0004Add users":["Додати користувачів"],"Order number of the video window occupied by a participant\\u0004Video window":["Вікно відео"],"Order number of the video window occupied by a participant\\u0004video window #%slot":["вікно відео #%slot"],"Popup header\\u0004Individual layout for":["Індивідуальна розкладка для"],"Message\\u0004Not found":["Не знайдено"],"Message\\u0004Too many search results. Please refine your search criteria.":["Занадто багато результатів пошуку. Будь ласка, уточніть критерії пошуку."],"Message\\u0004The list is empty":["Список порожній"],"Message\\u0004The user will be invited to the conference via email":["Користувач буде запрошений на конференцію ел. поштою"],"Message\\u0004HTTPS not enabled.":["Не налаштований HTTPS."],"Message\\u0004This feature requires HTTPS to ensure your data safety.":["З метою забезпечення безпеки ваших даних цей функціонал доступний тільки через HTTPS."],"Message\\u0004To solve this problem please contact your server administrator.":["Для вирішення проблеми ви можете звернутися до адміністратора вашого сервера."],"Message\\u0004List is empty":["Список порожній"],"Message\\u0004Recording is disabled for all conferences on the server":["Запис вимкнено для всіх конференцій на сервері"],"Message shown for empty list\\u0004Individual layouts have been created for all participants":["Індивідуальні розкладки створені для всіх учасників"],"Message shown for empty list\\u0004No items to display.":["Немає елементів для відображення."],"A subheader in the pop-up\\u0004Not displayed in the layout":["Не є учасниками розкладки"],"Subheader\\u0004Participants displayed in the layout":["Учасники, представлені в розкладці"],"Subheader\\u0004Your administrator":["Ваш адміністратор"],"Subheader\\u0004Phone":["Телефон"],"Subheader\\u0004Email":["Ел. пошта"],"Subheader\\u0004Participants not displayed in the layout":["Учасники, які не представлені в розкладці"],"A text hint displayed for a group of conference participants who cannot be added to the layout. These users cannot be added to the layout because they will be acting as interpreters in a multi-language meeting (they are not supposed to be seen by other participants).\\u0004Cannot be added to the layout":["Не можна додати до розкладки"],"A text hint displayed for one of the conference participants. The hint indicates that this person will act as an interpreter during a multi-language meeting. The word “interpreter” should be in the nominative case.\\u0004Interpreter":["Перекладач"],"The button that replaces the participant in the video slot.\\u0004Replace":["Заміна"],"The title of an input field\\u0004Name displayed in the video layout":["Ім\'я відображається у вікні відео"],"Error message\\u0004The field cannot be empty":["Поле не може бути пустим"],"Error message\\u0004Unfortunately, your administrator did not leave any contact details.":["На жаль, Ваш адміністратор не залишив контактних даних."],"Error message\\u0004The conference session has ended":["Сесія конференції закінчилася"],"Error message\\u0004Value is already in use. Please try another.":["Значення вже використовується. Будь ласка, спробуйте інше."],"Error message\\u0004The form has been filled incorrectly.":["Форма була заповнена неправильно."],"Error message\\u0004Number of characters in the field is 4-10.":["Кількість символів у полі 4-10."],"A text hint displayed to a conference moderator. The hint indicates that it is no longer possible to select a participant and invite him/her to the podium. To be on the “podium” means that a participant can be seen and heard by users who take part in a video meeting. The number of “podiums” is limited. Please check how the word “podium” was previously translated into the target language.\\u0004Unable to select. The maximum number of podiums has been exceeded":["Неможливо вибрати. Перевищено максимальну кількість заповнених трибун"],"A text hint indicating that a layout window is intended for a certain participant. This person will be constantly displayed in this window. If this participant does not join the meeting, this window will remain empty.\\u0004Fixed":["Фіксований"],"A text hint displayed to a conference moderator. He/she can configure settings for different windows. Moreover, one can change the type of a video window. For example, some windows can be used for displaying content while others will be displaying content. In this case, one cannot change the type of a video window due to certain restrictions.\\u0004Unable to change the type":["Неможливо змінити тип"],"A text hint displayed to a conference moderator. Please note that a “smart meeting” is a type of conference in which a participant can automatically become seen and heard as soon as he/she starts speaking. Moreover, this person does not have to ask for the moderator’s permission. The term “smart meeting” was selected due to marketing reasons and it is already used in the UI. So, please check how it was previously translated into the target language. Besides, an “Active speaker” slot is a type of video window used for displaying a participant who is speaking at the moment. So, if possible, please check how the term “Active speaker”  was previously translated into the target language.\\u0004In “smart meeting” mode, there must be at least two “Active speaker” slots in the layout":["У режимі «Автоселектор» повинно бути не менше двох слотів з типом «Автозаповнення»"],"A text hint indicating that a randomly-selected participant will be displayed in the video layout.\\u0004Random":["Випадковий"],"A text hint indicating that a randomly-selected participant will be displayed in the video window (slot) of the layout.\\u0004A random participant  will be displayed in this slot":["У слоті відображатиметься випадковий учасник"],"A text hint indicating that a video window will be used for displaying randomly selected participants. These participants can be moved from one window to another or replaced with a different participant. To some degree, this movement will be similar to card shuffling. However, you don’t have to translate the word “shuffling” verbatim.\\u0004Time-based shuffling":["Чергування за часом"],"A text hint indicating that a certain video window will be used for displaying a randomly selected conference participant. These participants will be rotated (alternated) every 30 or 60 seconds. The word “every” will be followed by the number of seconds. \\u0004Randomly participants will be alternated in this window every:":["У слоті будуть чергуватись випадкові учасники кожні:"],"The abbreviation for the word “seconds”. It is a part of the phrase like “conference participants will be rotated every 5 sec.” The shortened version of the word “seconds” is used here so that its ending does not depend on the preceding numeral.\\u0004sec.":["сек."],"A text hint indicating that the video window will be used for displaying the participant who will be speaking at the moment.\\u0004Active speaker":["Активний"],"A text hint describing who will be displayed in the video window.\\u0004The participant, who is speaking at the moment, will be displayed in this slot":["У слоті буде відображатися учасник, який говорить"],"A text hint indicating that a video window will be used for sharing content (e.g., slides, images, app windows, and so forth).\\u0004Content ":["Контент "],"A text hint displayed to a user who is configuring the settings of a slot (window)  in the layout created for a video meeting. In this case, the word “content”  may refer to slides, PDF documents, and application windows.\\u0004The slot will be used for sharing content. This slot can be selected only once":["У слоті транслюватиметься контент. Він може бути заданий один раз"],"A text hint indicating that no participant or content is currently displayed in the certain layout window.\\u0004Empty slot":["Порожній слот"],"A text hint indicating that a user can select a participant who will be displayed in the video layout.\\u0004Select a participant":["Виберіть учасника"],"The sidebar heading. Here, a user can configure the settings of a video window (slot). Please note that %n will be replaced with the window number. So, do not delete or edit this part of the sentence.\\u0004Slot %n settings":["Параметри слота %n"],"An error message. An access token is an object required to provide users of one server access to the user groups of other server.\\u0004Access token of your server to the %host_name is invalid or has expired.":["Ключ доступу вашого сервера до %host_name є недійсним або закінчився."],"A notification\\u0004Please try again within an hour or contact your server administrator.":["Будь ласка, спробуйте ще раз протягом години або зверніться до адміністратора вашого сервера."],"An error message\\u0004Failed to connect to the %host_name server.":["Не вдалося підключитися до сервера %host_name."],"An error message\\u0004Something went wrong.":["Щось пішло не так."],"An error message. An SSL certificate is a file needed to make sure that all the information shared between a user and a website remains private.\\u0004SSL certificate verification failed.":["Помилка перевіки сертифікату SSL."],"A text hint\\u0004To add the server address to the exception list in your browser, please continue to %host_name website and follow the instructions on the page.":["Щоб додати адресу сервера в список виключень безпеки вашого браузера, будь ласка, перейдіть на сайт %host_name і дотримуйтесь інструкції на сторінці."],"A text hint\\u0004Select a layout for":["Виберіть яку розкладку хочете налаштувати"],"The button enabling a user to go to the website\\u0004Continue":["Перейти на сайт"],"A text hint. The word will be followed by an error code such as 402.\\u0004Error code: %error_code":["Код помилки: %error_code"],"Name of group\\u0004Added users without group":["Додані користувачі без групи"],"Name of group\\u0004Users without group":["Користувачі без групи"],"Text on the button\\u0004Load more":["Завантажити більше"],"Text on the button\\u0004Select ID":["Обрати ID"],"Text on the button\\u0004Address book":["Адресна книга"],"Text on the button\\u0004All users":["Всі користувачі"],"Text on the button\\u0004Select":["Обрати"],"Text on the button\\u0004Cancel":["Скасувати"],"Text on the button\\u0004Add":["Додати"],"Text on the button\\u0004Contacts":["Контакти"],"Text on the button\\u0004Email":["Ел. пошта"],"Text on the button\\u0004Selected":["Вибрані"],"Text on the button\\u0004Add by id":["Додати по ID"],"Text on the button\\u0004Contact administrator":["Зв\'язатися з адміністратором"],"Text on the button\\u0004Disconnect":["Від\'єднати"],"Text on the button\\u0004Back to top":["Повернутися до початку"],"Text on the button\\u0004Collapse all":["Згорнути все"],"Text on the button\\u0004Remove":["Видалити"],"Text on the button\\u0004Confirm":["Підтвердити"],"An error message. A conference ID is an identifier of a virtual meeting. The identifier can be shared with conference participants so that they could join the meeting. The hint is supposed to tell a user that he/she is trying to do something which is\\u0004You cannot add a conference ID as a participant":["Неможливо додати ID конференції як учасника"],"The button for selecting several users\\u0004Select":["Обрати"],"The button for unmarking selected users\\u0004Deselect":["Зняти вибір"],"Hint\\u0004Displayed: [b]%n[/b] group users":["Відображено: [b]%n[/b] користувачів групи"],"Hint\\u0004Enter a user\'s name/ID or an endpoint ID":["Введіть ім\'я/ID користувача або ID підключення"],"Hint\\u0004Search":["Пошук"],"Hint\\u0004Groups":["Групи"],"Hint\\u0004Name":["Ім’я"],"Hint\\u0004Email":["Ел. пошта"],"Hint\\u0004Control panel is available only to conference owners and operators":["Панель управління доступна тільки для власників конференції та операторів"],"Hint\\u0004Enter user’s name, ID or email address":["Введіть ім\'я користувача, ID або адресу електронної пошти"],"Hint\\u0004There is no set layout":["Налаштованих розкладок немає"],"Hint\\u0004Conference details":["Інформація про конференцію"],"Title\\u0004User":["Користувач"],"Title\\u0004TrueConf ID":["Trueconf ID"],"Title\\u0004Email":["Електронна пошта"],"Title\\u0004Groups":["Групи"],"Title\\u0004Access denied":["Доступ заборонено"],"Title\\u0004First name":["Iм\'я"],"Title\\u0004Last name":["Прізвище"],"Title\\u0004Company":["Компанія"],"Title\\u0004Mobile phone":["Мобільний телефон"],"Title\\u0004Work phone":["Робочий телефон"],"Title\\u0004Home phone":["Домашній телефон"],"A table column header. Here, the administrator can check information about the license given to a user on a temporary basis. In particular, he/she can check when this license will cease to be active. It does not mean that the license will expire.\\u0004License will be active until":["Ліцензія активна до"],"The tooltip that appears when hovering a user whose account was deactivated by the admin.\\u0004Account is inactive":["Обліковий запис неактивний"],"Subtext\\u0004How to add endpoints":["Як додати пристрої"],"Title of button\\u0004Export to CSV (format compatible with %product_name)":["Експорт у CSV (у форматі, сумісному з %product_name)"],"Hint, appears after clicking the button to add email address\\u0004Address selected":["Адресу вибрано"],"Hint, appears after clicking the button to add email address\\u0004User already added":["Користувач вже доданий"],"Header\\u0004Add participants":["Додати учасників"],"Header\\u0004Hardware setup (%name)":["Налаштування обладнання (%name)"],"Header\\u0004User profile":["Профіль користувача"],"Search field hint\\u0004Search":["Пошук"],"A conferencing mode where all participants can see and hear one another\\u0004All on screen":["Усі на екрані"],"A conferencing mode for distance education\\u0004Video lecture":["Відеоурок"],"A conferencing mode. A role-based conference is a video meeting where only some participants are allowed to share their audio and video while other users cannot be heard and seen. To be on the podium means that a user can be seen and heard by conference participants. If a user is not on the podium, he/she cannot be seen or heard by others\\u0004Role-based":["Відеоселектор"],"Day of the Week\\u0004Monday":["Понеділок"],"Day of the Week\\u0004Tuesday":["Вівторок"],"Day of the Week\\u0004Wednesday":["Середа"],"Day of the Week\\u0004Thursday":["Четвер"],"Day of the Week\\u0004Friday":["П\'ятниця"],"Day of the Week\\u0004Saturday":["Субота"],"Day of the Week\\u0004Sunday":["Неділя"],"Day of the Week (abbreviation)\\u0004Mon":["Пн"],"Day of the Week (abbreviation)\\u0004Tue":["Вт"],"Day of the Week (abbreviation)\\u0004Wed":["Ср"],"Day of the Week (abbreviation)\\u0004Thu":["Чт"],"Day of the Week (abbreviation)\\u0004Fri":["Пт"],"Day of the Week (abbreviation)\\u0004Sat":["Сб"],"Day of the Week (abbreviation)\\u0004Sun":["Нд"],"Month\\u0004January":["Січень"],"Month\\u0004February":["Лютий"],"Month\\u0004March":["Березень"],"Month\\u0004April":["Квітень"],"Month\\u0004May":["Травень"],"Month\\u0004June":["Червень"],"Month\\u0004July":["Липень"],"Month\\u0004August":["Серпень"],"Month\\u0004September":["Вересень"],"Month\\u0004October":["Жовтень"],"Month\\u0004November":["Листопад"],"Month\\u0004December":["Грудень"],"Text hint\\u0004User will be invited to the conference via email":["Користувач буде запрошений на конференцію ел. поштою"],"Button to add email address to send invitation to the conference\\u0004Select":["Обрати"],"The name of the tab which contains address book contacts\\u0004Contacts":["Контакти"],"The name of the tab where you can send user an email invitation to the conference\\u0004Via email":["По ел. пошті"],"The name of the tab where the users marked for adding are located\\u0004Selected":["Вибрані"],"A notification displayed if a user locks a conference or makes it inaccessible to new participants. The hint indicates that in such a case email invitations cannot be sent to participants.\\u0004Email invitations are disabled when the conference is locked.":["Запрошення ел. поштою недоступно під час заборони на підключення."],"Input field name\\u0004Name":["Ім’я"],"Input field name\\u0004Email":["Ел. пошта"],"Input field error\\u0004This isn\'t correct email":["Це неправильна адреса ел. пошти"],"For multiselect\\u0004Selected:":["Вибрані:"],"Button designed to invite user to the conference again\\u0004Re-invite":["Повторно запросити"],"Context menu item for conference participant\\u0004Invite to podium":["Запросити на трибуну"],"Context menu item for conference participant\\u0004Remove from podium":["Видалити з трибуни"],"Context menu item for conference participant\\u0004Disconnect participants":["Відключити учасників"],"Context menu item for conference participant\\u0004Invite":["Запросити"],"Context menu item for conference participant\\u0004Disconnect participant":["Відключити учасника"],"Context menu item for conference participant\\u0004Turn on the camera":["Увімкнути камеру"],"Context menu item for conference participant\\u0004Turn off the camera":["Вимкнути камеру"],"Context menu item for conference participant\\u0004Unmute the microphone":["Увімкнути мікрофон"],"Context menu item for conference participant\\u0004Mute the microphone":["Вимкнути мікрофон"],"Context menu item for conference participant\\u0004Hardware setup":["Налаштування обладнання"],"Context menu item for conference participant\\u0004Dismiss from moderators":["Звільнити з ведучих"],"Context menu item for conference participant\\u0004Assign as a moderator":["Призначити ведучим"],"Context menu item for conference participant\\u0004Unselect":["Зняти виділення"],"Context menu item for conference participant\\u0004Select":["Обрати"],"Context menu item for conference participant\\u0004Customize video layout":["Налаштувати розкладку вікон відео"],"A text hint displayed when a mouse cursor is pointed to the button. If this option is selected, a user will not be seen by other conference participants.\\u0004Turn off the video":["Вимкнути відео"],"A text hint displayed when a mouse cursor is pointed to the button. If this option is selected, the selected user will be seen and heard by other conference participants\\u0004Turn on the video":["Увімкнути відео"],"A text hint displayed when a mouse cursor is pointed to the button. If this option is selected, a user will not be heard by other conference participants.\\u0004Mute microphone":["Вимкнути мікрофон"],"A text hint displayed when a mouse cursor is pointed to the button. If this option is selected, a user will be heard by other conference participants.\\u0004Unmute microphone":["Увімкнути мікрофон"],"Error\\u0004This conference ID does not exist":["Цей ID конференції не існує"],"Error\\u0004Error":["Помилка"],"Error\\u0004The number of speakers exceeded":["Перевищена кількість доповідачів"],"The heading for the notification displayed to a user when he/she is logged out of the web application. The user could be logged out because he/she stayed inactive for a certain time.\\u0004Your session has expired":["Сесія закінчилася"],"This message is displayed when a user does not have access to application settings\\u0004Try to open this window once again or contact your server administrator":["Спробуйте відкрити вікно ще раз або зверніться до адміністратора сервера"],"A text hint displayed to a user who wants to access the web application.\\u0004Please sign in again to access the personal area.":["Для входу в особистий кабінет потрібна повторна авторизація."],"The heading for a dialogue window. This display name is the name which is shown in the video layout during a conference. The term “display name” is already used in the UI so; please check how it was translated into the target language before. In the dialogue window, the meeting moderator can change the display name of a participant (he/she can type a new name).\\u0004Changing display name":["Зміна імені, що відображається"],"The button that will close the dialogue window.\\u0004Cancel":["Скасувати"],"The button that will save the changes. made by the user.\\u0004Save":["Зберегти"],"Dropdown menu item\\u0004None":["Відсутній"],"Dropdown menu item\\u0004Clear":["Очистити"],"Dropdown menu item\\u0004Make large":["Збільшити"],"Dropdown menu item\\u0004Make small":["Зменшити"],"Dropdown menu item\\u0004Auto-fill layout":["Заповнити розкладку автоматично"],"Dropdown menu item\\u0004Clear layout":["Очистити розкладку"],"Dropdown menu item\\u0004Delete layout":["Видалити розкладку"],"Dropdown menu item\\u0004Select":["Обрати"],"The heading of a pop-up window. Here, a user can select the audio channel that he/she wants to receive during a video meeting. Please note that here we are talking about a multi-language meeting assisted by interpreters. In this case, %Displayname is the name of the user. Do not delete or edit this part of the sentence.\\u0004Select interpretation channel (%Displayname)":["Виберіть канал перекладу (%Displayname)"],"The original audio stream received by the translator during a multi-language meeting. This stream will be translated to other languages.\\u0004Original audio":["Оригінал"],"Item in the list of languages\\u0004English":["Англійська"],"Item in the list of languages\\u0004Russian":["Російська"],"Item in the list of languages\\u0004Chinese":["Китайська"],"Item in the list of languages\\u0004Farsi":["Фарсі"],"Item in the list of languages\\u0004French":["Французька"],"Item in the list of languages\\u0004German":["Німецька"],"Item in the list of languages\\u0004Italian":["Італійська"],"Item in the list of languages\\u0004Japanese":["Японська"],"Item in the list of languages\\u0004Polish":["Польська"],"Item in the list of languages\\u0004Czech":["Чеська"],"Item in the list of languages\\u0004Portuguese":["Португальська"],"Item in the list of languages\\u0004Spanish":["Іспанська"],"Item in the list of languages\\u0004Ukrainian":["Українська"],"Item in the list of languages\\u0004Vietnamese":["В\'єтнамська"],"Item in the list of languages\\u0004Hebrew":["Іврит"],"Item in the list of languages\\u0004Korean":["Корейська"],"Item in the list of languages\\u0004Turkish":["Турецька"],"A pop-up title\\u0004Removing participants":["Видалення учасників"],"The title of a checkbox in the pop-up window displayed when a moderator removes a participant (or participants) from a video conference. If this box is checked, the selected participants will not be able to join the conference once again (reconnection).\\u0004Reconnection is not allowed":["Без можливості повторного підключення"],"A question in the pop-up window\\u0004Do you want to remove the selected participants from the conference?":["Ви дійсно хочете видалити вибраних учасників з конференції?"],"Confirmation window\\u0004Are you sure you want to disconnect the participant %DN from the conference?":["Ви впевнені, що бажаєте відключити учасника %DN від конференції?"],"Confirmation window\\u0004Delete the \\"%layout\\" layout?":["Видалити розкладку \\"%layout\\"?"],"The heading of a dialogue window. To be on the podium means that a user can be seen and heard by other conference participants. Please note that the word “podium” is already used in the UI. So, you need to check how this word was previously translated into the target language. In this section, a user can check how the podiums will be filled by conference participants.\\u0004Filling podiums":["Заповнення трибун"],"A text hint in the pop-up window. To be on the podium means that a user can be seen and heard by other conference participants. There is a limited number of “podiums” in a conference. This term is already used in the UI so, you need to check how this word was previously translated into the target language. Besides, for each conference there may be multiple layouts (arrangement of video windows).\\u0004The counter indicates how many podiums are vacant in all conference layouts":["Лічильник показує, скільки трибун для заповнення залишилося у всіх розкладках конференції"],"A text hint in the pop-up window. To be on the podium means that a user can be seen and heard by other conference participants. There is a limited number of “podiums” in a conference. This term is already used in the UI so, you need to check how this word was previously translated into the target language. In turn, a conference mode is a fixed group of settings for a video meeting.\\u0004The maximum number of podiums depends on the selected conference mode.":["Максимальна кількість трибун розраховується виходячи з вибраного режиму."],"A text hint in the pop-up window. To be on the podium means that a user can be seen and heard by other conference participants. There is a limited number of “podiums” in a conference. This term is already used in the UI so, you need to check how this word was previously translated into the target language. Besides, each conference may have multiple independent layouts.\\u0004The repeated display of the same participant in different layouts does not decrease the number of available podiums":["Повторне використання одного і того ж учасника в різних розкладках не займає кількість доступних трибун"],"Text in pop-up. The user can create a public conference opened to all participants. They only need to sign up (register) for this event. Under such circumstances, the use of PIN will be unavailable.\\u0004PIN is unavailable when conference registration is enabled":["PIN недоступний під час увімкнення реєстрації в конференції"],"The button for closing the pop-up window.\\u0004Close":["Закрити"],"A heading for one of the sections in the address book. In this section, the administrator can select conference participants\\u0004Select participants":["Вибрати учасників"],"A subheading in the conference settings menu. In this subsection, a user will determine for how long a meeting can be extended\\u0004Extending conference time":["Подовження конференції"],"A notification displayed in the dialogue window\\u0004Extend conference time for":["Виберіть час, на який ви хочете подовжити конференцію:"],"A notification displayed in the dialogue window\\u0004The conference will end in %n minutes. Do you want to extend it":["Конференція завершиться через %n хв. Продовжити конференцію?"],"A notification displayed in the dialogue window\\u0004The conference will end in %n minutes.":["Конференція завершиться через %n хв."],"A button\\u0004Cancel":["Скасувати"],"A button\\u0004Apply":["Застосувати"],"A notification indicating that a video meeting was extended\\u0004The conference was extended for %n minutes":["Конференцію було продовжено на %n хвилин"],"An option in the drop-down list. By clicking on one of the options from this list, a user will extend the conference for a certain period like 15 minutes, an hour or two hours\\u000415 min":["15 хвилин"],"An option in the drop-down list. By clicking on one of the options from this list, a user will extend the conference for a certain period like 15 minutes, an hour or two hours\\u000430 min":["30 хвилин"],"An option in the drop-down list. By clicking on one of the options from this list, a user will extend the conference for a certain period like 15 minutes, an hour or two hours\\u00041 hour":["1 година"],"An option in the drop-down list. By clicking on one of the options from this list, a user will extend the conference for a certain period like 15 minutes, an hour or two hours\\u00042 hours":["2 години"],"A text hint displayed when the mouse cursor is pointed to the icon.\\u0004Volume level":["Рівень гучності"],"A text hint displayed when a mouse cursor is pointed to the button.\\u0004Turn down microphone volume":["Зменшити рівень гучності мікрофона"],"A text hint displayed when a mouse cursor is pointed to the button.\\u0004Turn up microphone volume":["Збільшити рівень гучності мікрофона"]," A pop-up hint for a drop-down list with the options for managing a person, participating in a video conference. It will be possible to change the settings of the participant’s camera/microphone, appoint him/her as a moderator, or remove from the ongoing conference.\\u0004More":["Додатково"],"A pop-up hint displayed for a button. Please note that this hint is not an error message. It just indicates that a user is trying to do something which is not allowed by the application\\u0004You cannot remove yourself from the conference":["Ви не можете видалити себе з конференції"],"A text hint displayed to a moderator when he/she tries to remove a participant from a video meeting. This hint will be displayed if the participant selected by the moderator is the person who scheduled and created the conference (in other words, he/she is the owner of the conference). Please note that the word “owner” is already used in the GUI. So, you need to check how this word was previously translated into the target language.\\u0004You cannot remove the owner from the conference":["Ви не можете видалити власника з конференції"],"An option in the context menu. The display name is the name which is shown in the video layout during a conference. The term “display name” is already used in the UI so; please check how it was translated into the target language before.\\u0004Change display name":["Змінити ім\'я, що відображається"],"An option in the context menu. Here, a user can select the audio channel that he/she wants to receive. Please note that here we are talking about a multi-language meeting assisted by interpreters.\\u0004Select interpretation channel":["Вибрати канал перекладу"],"An option in the context menu displayed for a participant. If this option is selected, a moderator will go to the menu where one can set an individual layout for a participant.\\u0004Set custom layout":["Налаштувати індивідуальну розкладку"],"Filter status\\u0004Online users only":["Тільки онлайн-користувачі"],"Message shown when the search gave no results\\u0004No matches found":["Збіги не знайдено"],"Additional information for conference participant\\u0004Video window %number":["Вікно відео %number"],"Additional information for conference participant\\u0004No video window":["Без вікна відео"],"Menu item designed to choose users for video layout\\u0004For all":["Для усіх"],"Menu item designed to choose users for video layout\\u0004For SIP/H.323 devices and WebRTC":["Для SIP/H.323 пристроїв і WebRTC"],"Menu item designed to choose users for video layout\\u0004Individual video layout":["Індивідуальна розкладка"],"Button for adding new video layout\\u0004Add a video layout":["Додати розкладку вікон відео"],"Button (Number of video windows)\\u0004Number":["Кількість"],"Subheading. Used to select where to place names of the conference participants on video windows.\\u0004Name placement":["Розміщення імені"],"User name location at the video window\\u0004At the top":["В верхній частині"],"User name location at the video window\\u0004At the bottom":["В нижній частині"],"Not display user name on the video window\\u0004Not display":["Не відображати"],"Enable users to change their video layout\\u0004Enable users to change layout":["Дозволити користувачам змінювати розкладку"],"Disable users to change their video layout\\u0004Ban users from changing layout":["Заборонити користувачам змінювати розкладку"],"Button for selecting video layout\\u0004Layout":["Розкладка"],"The button for adding a new video layout for a conference.=\\u0004Add layout":["Додати розкладку"],"A text hint for an icon button. The hint indicates that the changes in the video layout were saved, but were not applied.\\u0004Layout changes have not been applied":["Оновлення у розкладці не застосовані"],"A text hint displayed to a user who configures conference settings. To be on the podium means that a user can be seen and heard by other conference participants. Please note that the word “podium” is already used in the UI. So, you need to check how this word was previously translated into the target language. In every conference, there is a limited number of “podiums”.\\u0004Filled podiums:":["Заповнено трибун:"],"This phrase is a counter indicating how many podiums (%n) have been taken by participants out of the total number (%m). Do not remove these parts of the sentence.\\u0004%n out of %m":["%n з %m"],"A text in the dialogue window\\u0004Are you sure you want to leave the layout empty? Recipients of this layout will be unable to see one another.":["Ви дійсно хочете залишити розкладку порожньою? Одержувачі розкладки не бачитимуть один одного."],"Title of window\\u0004Do you want to exit? The changes will not be saved.":["Ви дійсно хочете вийти? Зміни не будуть збережені."],"The section heading. Here, a user will be able to create a new layout for a video conference.\\u0004New layout":["Нова розкладка"],"The button that will enable a user to save changes in the video layout.\\u0004Save":["Зберегти"],"Notification\\u0004Layout has been updated":["Розкладка була оновлена"],"Type of video layout\\u0004Gallery view":["Усі вікна однакового розміру"],"Type of video layout\\u0004Video windows of conference participants overlap the big priority video window on the bottom":["На велике пріоритетне відеовікно накладаються знизу відеовікна інших учасників"],"Type of video layout\\u0004The big priority window is located in the left corner of the screen":["У лівому кутку розташовується збільшене пріоритетне відеовікно"],"Type of video layout\\u0004The big priority window is located at the top of the screen":["Зверху розташовується збільшене пріоритетне відеовікно"],"Type of video layout\\u0004The big priority window is located on the left of the screen":["Зліва розташовується збільшене пріоритетне вікно"],"A pop-up tip displayed when the mouse cursor is pointed to the layout icon. In this context, “spotlighted” means that the window will be larger than other windows\\u0004Spotlighted window in the center":["Пріоритетне відеовікно розташовується в центрі"],"A pop-up tip displayed when the mouse cursor is pointed to the layout icon. “Spotlighted” windows will be larger than other windows\\u0004Two spotlighted windows above smaller windows":["Два пріоритетних відеовікна розташовуються зверху"],"Subheading for the list of the users. Their videos are  not displayed in the general layout\\u0004Participants out of layout":["Учасники не в розкладці"],"Subheader for the speakers (participants on the podium)\\u0004Speakers":["Доповідачі"],"Subheader for the participants who are not on the podium\\u0004Attendees":["Учасники"],"Subheader for the participants who are not on the podium\\u0004In the waiting room":["У кімнаті очікування"],"Subheader for the users who have not connected to the conference\\u0004Unconnected users":["Непідключені користувачі"],"A text hint displayed when a mouse cursor is pointed to the button. Button which opens a window for adding users to the conference.\\u0004Add users into the conference":["Додати користувачів у конференцію"],"General name for slideshow and content sharing\\u0004Content":["Контент"],"A notification. To be on the podium means that a user can be seen and heard by other conference participants. Please note that the word “podium” is already used in the UI. So, you need to check how it was previously translated into the target language. This hint specifies the number of podiums that can be taken by participants. The numeral 3 is hard-coded; so, no other value will be used.\\u00043 vacant podiums are remaining":["Залишилось 3 доступні трибуни"],"Button to open a window with detailed information\\u0004More":["Детальніше"],"A text hint indicating that a randomly selected conference participant will be displayed in the video window of the layout created for a meeting. Please note that %n will be replaced with the number of the window. So, do not delete or edit this part of the phrase.\\u0004%n - Random participant":["%n - Випадковий учасник"],"A text hint displayed for a video window. This hint indicates that conference participants will be rotated (shuffled) in the selected window, e.g., every 10 seconds. Please note that %n will be replaced with the number of the window. So, do not delete or edit this part of the phrase.\\u0004%n - Shuffling":["%n - Чергування"],"A text hint indicating that a certain video window is used for displaying the participant who is speaking at the moment. Please note that %n will be replaced with the number of the window. So, do not delete or edit this part of the phrase.\\u0004%n - Active speaker":["%n - Активний"],"A text hint indicating that content (slides, images, or PDF files) will be displayed in the selected layout window. Please note that %n will be replaced with the number of the window. So, do not delete or edit this part of the phrase.\\u0004%n - Content":["%n - Контент"],"A text hint indicating that no participant or content is currently displayed in the certain layout window. Please note that %n is the number of a video window. So, do not delete or edit this part of the sentence.\\u0004%n - Empty":["%n - Порожньо"],"A text hint displayed to a user when he/she tries to change the layout (arrangement of video windows) during a meeting. In a video lecture, the layout is fixed. There is only one person displayed in the layout (the lecturer). So, one cannot change the arrangement of windows in any way.  Please note that the term “video lecture” is already used in the UI.So, if possible, you will need to check how this term was previously translated into the target language.\\u0004The layout cannot be changed in “Video lecture” mode":["Розкладка не може бути змінена в режимі «Відеоурок»"],"The heading of a pop-up. Here, the admin can configure volume settings.\\u0004Volume settings":["Налаштування гучності"],"A subheading in the pop-up window. Here, the administrator can set the volume of the audio stream received from the speaker. Please note that the phrase “source language” is used because we are talking about a multi-language meeting assisted by interpreters.\\u0004Source language volume in interpreter channels":["Гучність оригіналу в каналах перекладу"],"The button for applying the changes made by the administrator.\\u0004Apply":["Застосувати"],"Opens additional display settings\\u0004Display settings":["Налаштування екрану"],"A notification displayed to a user when he/she “locks the conference”. To lock means to make an ongoing conference inaccessible to new participants.\\u0004The conference is locked":["Вхід до конференції заборонено"],"A notification displayed to a user when he/she unlocks an ongoing conference; in other words, the user makes the meeting accessible to new participants.\\u0004The conference is unlocked":["Вхід до конференції дозволено"],"A notification displayed when conference participants are sent to a virtual waiting room before they can participate in a meeting. They cannot be seen or heard by other users\\u0004Users will be sent to the waiting room before joining the conference":["Тепер користувачі при вході в конференцію потраплятимуть до кімнати очікування"],"A text hint indicating that a virtual meeting is being recorded\\u0004Recording":["Йде запис"],"An option in the conference context menu. If this option is selected, control buttons will be removed from participants’ video windows.\\u0004Hide control buttons in video windows":["Приховати кнопки керування у вікнах відео"],"An option in the context menu. If this option is selected, control buttons will be displayed in each video window added to the layout.\\u0004Show control buttons in video windows":["Показувати кнопки керування у вікнах відео"],"An option in the context menu.  If this option is selected, a conference moderator will hide the list of participants who are not displayed in the video layout.\\u0004Hide participants not added to video layout":["Приховати учасників не в розкладці"],"An option in the context menu. If this option is selected, a conference moderator will see the list of participants who are not displayed in the video layout.\\u0004Show participants not added to video layout":["Показати учасників не в розкладці"],"An option in the context menu. If this option is selected, the names of participants will be displayed in a list-like manner (each name will start from a new line).\\u0004List view":["Вигляд списком"],"An option in the context menu. If this option is selected, the list of conference participants will be displayed in the tile-like manner (somewhat similar to a grid or a table).\\u0004Tile view":["Вигляд плиткою"],"A button leading to video layout settings\\u0004Layouts":["Розкладки"],"A button enabling a user to view the list of participants\\u0004Participant List":["Список учасників"],"A button enabling a user to view the list of participants\\u0004Participants":["Учасники"],"An option in the context menu. This option opens the pop-up window where the moderator can change the unique identifier of a video meeting.\\u0004Change conference ID":["Змінити ID конференції"],"A button enabling a user to extend a video meeting\\u0004Extend conference time":["Подовжити конференцію"],"An option in the context menu. This option opens the pop-up window where the moderator can change the PIN required for joining the conference.\\u0004Change PIN required for joining":["Змінити PIN для входу"],"An option in the context menu. If this option is selected, conference participants will be required to enter a PIN if they want to join a video meeting.\\u0004Request PIN for  joining":["Увімкнути вхід за допомогою PIN"],"An option in the context menu. This option opens the pop-up window where the moderator can change the PIN required for joining the conferenceAn option in the context menu. This option opens the menu where the admin can set the volume of the audio stream received from the speaker. Please note that the phrase “source language” is used because we are talking about a multi-language meeting assisted by interpreters.\\u0004Source language volume":["Гучність оригінальної доріжки"],"The button that enables a user to “unlock a conference” or make it available to participants. They will be able to join the ongoing meeting.\\u0004Unlock conference":["Дозволити вхід"],"The button that enables a user to make an ongoing meeting inaccessible to new participants. They will no longer be able to join the meeting.\\u0004Lock conference":["Заборонити вхід"],"A text hint for a button that makes it possible for new participants to join an ongoing meeting.\\u0004Allow new participants to join the conference":["Дозволити вхід нових учасників до конференції"],"A text hint for an icon button. If this button is clicked,  new participants will no longer be able to join an ongoing meeting.\\u0004Do not allow new participants to join the conference":["Заборонити вхід нових учасників до конференції"],"An option in the context menu. If this option is selected, participants will immediately join the meeting without having to stay in the waiting room. Other users will see and hear them (up to 54 characters including spaces).\\u0004Disable waiting room":["Вимкнути кімнату очікування"],"An option in the context menu. If this option is selected, new conference participants will be sent to a virtual waiting room before joining a meeting. They will not be seen or heard by other users (up to 54 characters including spaces).\\u0004Enable waiting room":["Увімкнути кімнату очікування"],"The title of a menu where a user can start video recording\\u0004Recording":["Запис конференції"],"An option in the context menu. If this option is selected, the conference will be ended for all participants (up to 54 characters including spaces)\\u0004End for all":["Завершити конференцію для всіх"],"The heading for a pop-up window. Here, the moderator can change the identifier of a video meeting.\\u0004Changing conference ID":["Зміна ID конференції"],"Field name\\u0004Conference ID":["ID конференції"],"The button for saving changes.\\u0004Save":["Зберегти"],"An error message displayed if a user does not fill out a required field.\\u0004Please fill out this field":["Будь ласка, заповніть це поле"],"Window title\\u0004Conference":["Конференція"],"HTML player code\\u0004HTML player code":["HTML код плеєра"],"HTML conference code\\u0004HTML conference code":["HTML код конференції"],"Text has been copied\\u0004Copied":["Скопійовано"],"Conference type\\u0004Type":["Тип"],"Conference type\\u0004Private":["Внутрішня"],"Conference type\\u0004Public":["Публічна"],"Conference mode\\u0004Mode":["Режим"],"The number of participants in the conference\\u0004In conference":["У конференції"],"The number of users invited to the conference\\u0004Invited users":["Запрошені користувачі"],"One of the subheadings in the menu that provides information about a video meeting.  Here, a user can check if it is possible for new participants to join an ongoing meeting.\\u0004Access status":["Вхід у конференцію"],"A text hint in the menu that provides information about a video meeting. The hint indicates that new participants will be unable to join an ongoing meeting.\\u0004Locked":["Заборонено"],"A subheading in the menu indicating how many conference participants (presenters) are now able to share audio and video with other users.  Other participants (attendees) can only watch and listen\\u0004Presenters on the podium:":["Доповідачі на трибуні:"],"A text hint indicating how many participants (n) are currently participating in the conference. In its turn “m”  indicates how many users may join the conference at the same time\\u0004n% (out of m%)":["n% (з m%)"],"A subheading in the menu indicating how many people are taking part in a meeting\\u0004Conference participants:":["Учасники конференції:"],"Conference ID\\u0004Conference ID":["ID конференції"],"Information about the meeting room where the conference will be held\\u0004Meeting location":["Місце проведення"],"External conference page link\\u0004External page link":["Посилання на зовнішню сторінку"],"Conference owner\\u0004Owner":["Власник"],"UDP Multicast Address\\u0004UDP Multicast Address":["UDP Multicast адреса"],"RTSP streaming\\u0004RTSP streaming":["RTSP-трансляції"],"The heading for a pop-up window. Here, the moderator can enter a PIN that participants will have to enter in order to join the meeting.\\u0004Joining with a PIN":["Вхiд за допомогою PIN"],"Text hint displayed in blank entry field\\u0004Conference PIN (4-10 digits)":["PIN конференції (4-10 цифр)"],"The button for disabling the use of PIN required for joining a video conference. The users will not have to enter a PIN in order to join a video meeting.\\u0004Do not request PIN for joining":["Вимкнути вхід через PIN"],"The text hint in the pop-up window displayed to a user who tries to record a video meeting. The hint indicates that this meeting (and other meetings) will be recorded on the server. So, it is not possible to start video recording on the client side.\\u0004All conferences will be recorded on the server":["Запис увімкнено для всіх конференцій на сервері"],"The text hint. The owner is the person who created the conference. Please check how this word was previously translated into the target language.\\u0004The conference can be recorded only by the owner or server administrator":["Записувати конференцію може лише власник або адміністратор сервера"],"The button that ends video recording and opens the menu for saving the recording file\\u0004Stop":["Зупинити"],"A text hint in the menu where a user can start video recording\\u0004Click on the button to start recording":["Почніть запис конференції, натиснувши кнопку"],"Title in a pop-up window. This pop-up window will be displayed when the virtual waiting room is disabled. These users cannot be seen or heard by other participants.\\u0004Disabling the waiting room":["Вимкнення кімнати очікування"],"Notification in a pop-up window. This pop-up window will be displayed when the virtual waiting room is disabled. These users cannot be seen or heard by other participants.\\u0004What would you like to do?":["Виберіть дію, яку необхідно зробити з користувачами в кімнаті очікування:"],"A button.\\u0004Confirm":["Підтвердити"],"A notification displayed when the moderator disables waiting room mode. Waiting room is a virtual space participants are sent to before they can join the discussion\\u0004Waiting room disabled":["Кімната очікування вимкнена"],"A radio-button. If this option is selected, all participants in the waiting room will be allowed to join the conference. They will be able to see and hear other conference participants.\\u0004Invite all":["Запросити усіх"],"A radio button. If it is selected, all users, who are put in the waiting room, will be removed from the conference.\\u0004Disconnect all":["Відключити усіх"],"A text hint displayed for a button. The button enables a user to open conference layout settings\\u0004Go to video layout settings":["Перейти до налаштування розкладок конференції"],"A text hint for a button. When the button is clicked on, a user will open a list of participants. Besides, the user will be able to mute/unmute participants’ microphones or enable/disable their cameras.\\u0004Manage meetings participants":["Перейти до списку учасників для управління"],"The heading for a pop-up displayed when the conference moderator ends a meeting\\u0004Ending a conference for all":["Завершення конференції для всіх"],"A question in the dialogue window\\u0004Do you want to end the conference for all participants?":["Ви впевнені, що хочете завершити конференцію для всіх?"],"Button to end the conference\\u0004End":["Завершити"],"A section where the moderator can change some settings of an ongoing video conference. For example, it is possible to change the layout of video windows,  invite new participants, or mute / unmute participants\' microphones.  In this case there is no need to end the conference and re-start it. All the changes will take place on the fly.\\u0004Real-time management":["Розширене управління"],"A button enabling a user to continue the conference for a certain period\\u0004Extend":["Продовжити"],"A text hint indicating that a video recording has been saved\\u0004The recording has been saved on the server":["Запис збережено на сервері"]}}}')}}]);